//获取当前登录用户的菜单列表
export function getCurrentMenu() {
    return {
        url: /\/sysMenu\/list/,
        method: 'get',
        handler (params){
            return{
                state: 1,
                data: [
                    {
                        label: '根菜单',
                        code: 'root',
                        path: '/'
                    },
                    {
                        label: '首页',
                        code: 'index',
                        path: 'index'
                    }
                ]
            }
        }
    }
}

//获取当前用户信息
export function getCurrentUser() {
    return {
        url: /\/sysUser\/info/,
        method: 'get',
        handler (params){
            return {
                state: 1,
                data: {
                    id: 1,
                    name: '系统管理员',
                    headImg: 'data:image/png;base64,'
                }
            }
        }
    }
}